module.exports = "<div class=\"container py-20 mx-auto\">\n    <h2 class=\"text-black text-xl pl-2 border-l-4 border-red-600 mb-6\"> GoBlitz Website & App Privacy Policy<br><em>Version: (1/3/2020)</em></h2>\n    <div class=\"\">\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>General</strong><br>\n            This Privacy Policy (\"Policy\") explains how GoBlitz, its Affiliates, Associates, Advertisers and Advisors (hereinafter referred to as “we”, “us” or “our”) collects, uses, discloses and protects the Personal Information, obtained explicitly through the website https://www.goblitz.tv(\"the website\") and its IOS/Android  Applications  (\"Application\"),  as  well  as  other  information  automatically  tracked  while navigation. When you create an account and profile on the GoBlitz platform , we collect certain 'Personal Information' which includes information that will be available for viewing to a User of the GoBlitz Platform. Details pertaining to User's full name, age, marital status, nationality, gender, contact number/mobile number,address, IP address, e-mail address are other examples of Personal Information. This Privacy Policy also governs services, features, products, properties, or content we offer (\"Offerings\").<br>\n            Such information will not be considered as sensitive if it is freely available and accessible in the public domain or is furnished under the Right to Information Act, 2005 or any other law for the time being in force.<br>\n            Upon visiting the Website, you agree to this Policy with respect to the collection, processing and use of your personal data by us. Upon visiting our App, you agree to this Policy with respect to the collection, processing and use of your personal data by us.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Collection of Information</strong><br>\n            We collect and store the information and content that you post to the GoBlitz Platform, including your articles, essays, pictures and any kind of write ups. Unless you have posted certain content anonymously, your Content, date and time stamps, and all associated comments are publicly viewable on the GoBlitz Platform, along with your name.<br>\n            Your Contact information will be used to communicate with you (via e-mail, phone, text message, through the GoBlitz Platform or otherwise). When you communicate with us (via email, phone, text message, through the GoBlitz Platform or otherwise), we may maintain a record of your communication. By disclosing your contact information to GoBlitz, you consent to our use of your contact information to communicate with you.<br>\n            To improve the responsiveness of the sites for the users, GoBlitz may use \"cookies\", or similar electronic tools to collect information to assign each visitor a unique, random number as a User Identification (User ID) to understand the user's individual interests using the Identified Computer. Unless the user voluntarily identify himself/herself (through registration, for example), GoBlitz will have no way knowing who the user is,  even if GoBlitz assign a cookie to the user’s computer. The only Personal Information a cookie can contain is information the user supply. A cookie cannot read data off the hard drive. GoBlitz’s ’s advertisers may also assign their own cookies to the user’s browser (if the user click on their ads), a process that GoBlitz does not control.<br>\n            We collect certain information from and about its users directly from the user, and amongst other means, from Web server logs and with cookies.<br>\n            To prevent unauthorized access, maintain data accuracy, and ensure the correct use of information, we put in place appropriate physical, electronic, and managerial procedures to safeguard and secure the information collected online.<br>\n            Subscribers And Visitors: In order to allow a visitor to gain an authorized access to the contents on the website, we obtain the complete information of the user such as contact information (full name, address, and telephone number), e-mail address, and method of payment, company details, designation, etc through the process of registration.<br>\n            By visiting, accessing or availing any services available on the Website or Mobile App, the user explicitly consents to, without limitation or qualification, to the collection, storage, processing disclosure, use and transfer of his/her Personal Information provided by him/her in the manner as described in this Privacy Policy.<br>\n            The following information may be automatically collected when you visit and use the Website:\n            <ul style=\"font-size: 14px; list-style: disc; padding-left: 30px; line-height: 24px;\">\n                <li>The type of operating system you use</li>\n                <li>your IP address</li>\n                <li>your browser type</li>\n                <li>information about your use of the Website (when, how, how long, account used to log in, features/Scenes/Groups used while logged in; status and quantity of devices; operation mode)</li>\n                <li>installations / smart devices (Soft-/Firmware versions of Gateway & Devices)</li>\n                <li>first activation date</li>\n                <li>clicks</li>\n                <li>GPS and/or WIFI Position</li>\n                <li>Your used language etc.</li>\n            </ul>\n            The information we collect helps us administer the Website, analyze its usage, protect the Website and its content from inappropriate use and improve the user experience.<br>\n            Where possible, unique identifiers are anonymized and at no time do we attempt to identify you as an individual.<br>We do not collect precise real-time location information about your device.<br>\n            Cookies: A cookie is a small amount of data that is sent to a user's browser from a web server and is eventually stored on a user's computer hard drive. This anonymous information is maintained distinctly and is not linked to the Personal Information one will submit to us. The anonymous information will be used for our understanding of how the website is used and for other statistical purposes. The website uses cookies to store information, such as the user’s personal preferences after first visit to the site. Whether the user wants its web browser to accept cookies or not is up to the user. User can, thus, disable cookies by changing his browser settings, but this will disable some of the functionality or some parts of the website and make them inaccessible.<br>\n            Log Files: As with most other websites, the website collects and uses the data contained in log files. The information in the log files will include browser types, areas of the website that are visited, the website from which a user came and the pages visited by the user throughout the website. We routinely use this web log information in the aggregate in order to administer and improve the website & ensure security.<br>\n            When a user uses one of the location-enabled services (for example, when he/she access Services from a mobile device), GoBlitz may collect and process information about the mobile device’s GPS location (including the latitude, longitude or altitude of your mobile device) and the time the location information is recorded to customize the Services with location-based information and features (for example, to inform you about restaurants in your area or applicable promotions). Some of these services require personal data for the feature to work and GoBlitz may associate location data with the users device ID and other information. If a user wishes to use the particular feature, he/she will be asked to consent to the users data being used for this purpose. The user can withdraw his/her consent at any time by disabling the GPS or other location-tracking functions on the device, provided the device allows to do this. See the device manufacturer’s instructions for further details.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Personal Data collected directly from you</strong><br>\n            <strong>Express consent</strong><br>\n            The user expressly consents uploading his/ her Information, as may be necessary to enable us to provide the required services.<br>Registration with us is mandatory in order to be able to fully use the Website and to enable successful delivery of our offering. You will be asked to choose a user identity and password for your identification by us as a registered user for future use of our website by you. In the event you register with us, you will be asked to provide the below personal information (\"PI\"):\n            <ul style=\"font-size: 14px; list-style: disc; padding-left: 30px; line-height: 24px;\">\n                <li>your name (Title, academic Title, First and Last Name);</li>\n                <li>your communication data (valid email address and phone number);</li>\n                <li>your postal address;</li>\n                <li>your username;</li>\n                <li>your password;</li>\n                <li>your preferred language;</li>\n                <li>Other personal information explicitly stated to be required at the time of registration.</li>\n            </ul>\n            Our website offers the functionality of registration through “Third-Party Social Networking Websites” accounts (“Social Accounts”). In case you choose to register this way, you will have to log-in and link your Social Account with the website, subject to being permitted by your Social Account service provider. You may link your Social Account either by providing your Social Account login information to us through the website; or allow us to access your Social Account, in accordance with the applicable terms and conditions that applies on your usage of each Social Account. We shall make use of and store your personal information and other public information stored in your Social Accounts to create your account and Profile Page; however, such usage shall be restricted by the terms and conditions and the privacy settings that you may have applied on your Social Accounts.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Confidentiality of your login id and password</strong><br>\n            The user is responsible for maintaining the security of his/her Login ID and Password, and may not provide these credentials to any third party. If the users believe that they have been stolen or been made known to others, the user must contact us immediately at <a href=\"mailto:support@GoBlitz.tv\" target=\"_blank\">support@GoBlitz.tv</a>. GoBlitz is not responsible if someone else accesses the users account through registration information they have obtained from the user or through a violation by the user of this Policy of Use.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>How and why do we use your personal data</strong><br>\n            We use your personal data in particular to provide, maintain and improve our Website and Offerings, to communicate with you, to contact you about the Website, as well as for promotional purposes.<br>\n            In particular, we use your personal data for the following purposes:\n            <ul style=\"font-size: 14px; list-style: disc; padding-left: 30px; line-height: 24px;\">\n                <li>To provide, maintain and improve the Website and our offerings to you</li>\n                <li>To inform you about new versions or features of the Website</li>\n                <li>To tailor the content and information that we may send or display to you on the GoBlitz Platform, to suggest followers and content, offer location customization, and personalized help and instructions, and to otherwise personalize your experiences while using the GoBlitz Platform.</li>\n                <li>To respond to your questions and requests, including your customer service inquiries</li>\n                <li>To send you communications and marketing material about products, services, offers, promotions, properties, rewards, and events offered by us or by any of our affiliates; and provide news and information we think will be of interest to you; these offers may include targeted special offers for properties, goods and services tailored to you that are offered by us or by any of our affiliates</li>\n                <li>To send you promotional emails about products, services, offers, promotions, properties, rewards and events offered by us or by any of our affiliates, provided that you gave your double opt-in consent to receive such email marketing from us</li>\n                <li>For authentication and protection against identity fraud and identity theft</li>\n                <li>To monitor and analyze trends, usage and activities in connection with the Website</li>\n                <li>To send you emails related to your use of the Website and the Offerings in general, including alerts</li>\n                <li>To send you technical notices, updates, security alerts and support and administrative messages</li>\n                <li>For enforcing the terms and conditions</li>\n                <li>To comply with legal obligations, as part of our general business operations, and for other business administration purpose.</li>\n                <li>Where we believe necessary to investigate, prevent or take action regarding illegal activities, suspected fraud, situations involving potential threats to the safety of any person or violations of our Terms of Service or this Privacy Policy.</li>\n                <li>Legal Purposes: We may share your information to the law enforcement and other government agencies, courts and other bodies on their legal requests to comply with the law and aid to the ongoing and impending legal proceedings. We may also use your information when it is necessary to investigate, prevent, or take action regarding possible illegal activities or to comply with legal process or to address threats to the physical safety of any person or to safeguard the rights of our employees, users, or the public at large.</li>\n            </ul>\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Third party access to your personal data</strong><br>\n            We do not share, sell, rent or trade your personal data to non-affiliated third parties for their own marketing purposes except as mentioned in this Policy. We share your personal data with some dedicated third parties for some limited specific purposes only as described in this Policy.<br>\n            We may share your personal data for the following purposes and with the following persons/entities:\n            <ul style=\"font-size: 14px; list-style: disc; padding-left: 30px; line-height: 24px;\">\n                <li>Trusted service providers: entities who need access to such information in order to carry out work on our behalf relating to the Website, that do not have an independent use of the information we disclose to them, and have agreed to adhere to the rules set forth in this Policy;<br>i.e. entities that assist us with the hosting of the Website, the processing of your personal data as collected by the Website as commissioned data processor, consulting, marketing, advertising, information technology, Website usage analytics, and any other services that we use in our operations in relation to the Website</li>\n                <li>Affiliates: our affiliates may use your information (whether alone, combined with other information, or in the aggregate) for their everyday business purposes; as part of the services that they provide to you; to market properties, products and services to you; and to develop properties, products or services.</li>\n                <li>To law enforcement, government representatives or others where required by law</li>\n                <li>To a representative of a payment verification service, financial institution, or credit card company</li>\n                <li>In connection with the sale, purchase, merger, or reorganization of all or a portion of our business</li>\n                <li>When we believe it is necessary to protect the rights, property, safety of ours or to comply with a judicial proceeding, court order, or legal process, or as evidence in litigation in which we are involved.</li>\n            </ul>\n            We may also share aggregated or de-identified information, which cannot reasonably be used to identify you.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Information Related to Advertising or Third-Party apps and websites:</strong><br>\n            To support and enhance the Offerings, we may serve third-party advertisements or communicate link to third-party websites and applications. These advertisements and links are sometimes targeted and served to particular users and may come from third party companies called “ad networks.” Ad networks include third party ad servers, ad agencies, ad technology vendors and research firms.<br>\n            These third-party advertisements, websites and applications or any products or services offered through them are operated wholly by such third-parties and are not controlled by, or affiliated to, or associated with us unless expressly specified. We are not responsible for the transmission of information of any type and in any form, whatsoever, to and from such third-party. Any inclusion or exlusion of such third-party information shall not deemed as an endorsement by us towards such third-party and accordingly, we are not responsible for the accuracy, integrity and quality of information of any type as may be available on such thrid-party websites or applications. Further, these third-party websites and applications may automatically receive your IP address to send advertisements to your browser and may make the use of cookies, JavaScript, web beacons and other technologies to measure the effectiveness of their advertisements and to personalize advertising content. Such practices are not governed by this privacy policy. You acknowledge that these third-party websites or applications are governed by their respective privacy policies and terms & conditions. It is recommended that you take any independent check on the privacy policies and terms & conditions of each or any of such third-party websites and applications before visiting or using any information presented therein. GoBlitz partners with third party advertising networks to display advertisements targeted to visitors of the Offerings.<br>\n            GoBlitz does not disclose any Personal Information to any third party companies for purposes of partnerships or advertising.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Aggregate Information:</strong><br>\n            We may collect statistical information about how both unregistered and registered users, collectively, use the Offerings (“Aggregate Information”). Some of this information may be derived from Personal Information. This statistical information is not Personal Information and cannot be tied back to you, your Account or your web browser.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Additional Policy Information</strong><br>\n            Single Sign-On: The user can login to GoBlitz’s Website or Mobile App using sign-in services such as Facebook, Google or Linkedin. These services will authenticate the user’s identity and provide the user, the option to share certain Information with GoBlitz, such as, their sign-in information, name and email address to link between the sites. Social networking media services like Facebook and Twitter give you the option to post information about your activities on this Website to your profile page to share with others within your network.<br>\n            Communication, engagement and actions taken through external social media platforms that this website and its owners participate on are custom to the terms and conditions as well as the privacy policies held with each social media platform respectively.<br>\n            Users are advised to use social media platforms wisely and communicate / engage upon them with due care and caution in regard to their own privacy and personal details. This website may ask for personal or sensitive information through social media platforms.<br>\n            This website may use social sharing buttons which help share web content directly from web pages to the social media platform in question. Users are advised before using such social sharing buttons that they do so at their own discretion and note that the social media platform may track and save your request to share a web page respectively through your social media platform account.<br>\n            Posting certain requirements on the Site for certain properties, whether for sale or rent, may require the user to provide GoBlitz with Personal Information such as his/her valid ID proof and proof of employment, prior to posting such requirements. The user hereby acknowledges and permit GoBlitz (directly or through its contractors) to contact him/her to at the contact number as provided by him/her, for intimating him/her on events, potential buyers, tenants or properties that other Site users might be interested in. The user further consent to GoBlitz maintaining in our records his/her contact details that would be used for customer inquiry purposes.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Data Security</strong><br>\n            We have implemented reasonable and adequate physical, electronic and procedural safeguards to protect your personal data from accidental loss and from unauthorized access, use, or disclosure We limit access to your personal data to authorized employees and contractors on a strict need to know basis. We store your personal data in a data center with restricted access and appropriate monitoring, and we use a variety of technical security measures to secure your personal data. In addition, we use intrusion detection and virus protection software.<br>\n            However, please be aware that no security system can prevent all potential security breaches and note that we do not guarantee that unauthorized persons will always be unable to defeat our security measures.<br>\n            Also, please note that we may store and process your personal data in systems located outside of your home country. However, regardless of where storage and processing may occur, we take appropriate steps to ensure that your personal data is adequately protected, consistent with the privacy principles set forth under this Policy.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Changes to this Policy</strong><br>\n            By signing up for the Offerings of the Website, the User consents to the collection and use of the previously mentioned information on the Website. We may periodically change the privacy policy without notice, and user is responsible for checking the policy periodically for revisions. All amended Terms become effective upon our posting to the Website, and any use of the Website after such revisions have been posted signifies the consent of the user to the changes. Where the changes are significant, a more prominent notice through email notification will be sent.\n        </div>\n        <p class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Data retention and account deletion</strong><br>\n            You have the option to terminate your account by visiting the relevant page in your profile settings on the website. We will remove all of your public information and posts, if any, on such termination and shall dissociate them from your account profile so that it is seen anonymous and not attributed to your identity. However, we may retain certain information about you for the purposes authorized under this Privacy Policy unless prohibited by law. The information is retained to prevent, investigate, or identify possible wrongdoing in connection with the Offering or to comply with legal obligations.\n        </p>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Your rights & choices</strong><br>\n            You may, of course, decline to submit information through the GoBlitz Platform, in which case we may not be able to provide certain services to you. You may also control the types of notifications and communications we send, limit the information shared within the GoBlitz Platform about you, and otherwise amend certain privacy settings. Here is some further information about some of your choices:<br>\n            You may post certain content anonymously, including essays and articles. In such event, your name is not displayed along with the content, and GoBlitz does not associate such content with your user ID and other profile data. For further information see how anonymity works on GoBlitz.<br>\n            You may edit or delete the write ups that you post at any time. Any deleted content will be removed from third party sites from which it has been shared via GoBlitz’s standard sharing features; however we have no control over deletions or changes to Your Content if it has been shared manually by others. When you make edits to Your Content, other users will be able to see the history of those edits in your profile activity and on content edit logs.<br>\n            If you choose Delete Your Account in your privacy settings, then all of Your Content will be removed from public visibility on the GoBlitz Platform, and it may not be restored by us, even if you change your mind. If you choose Deactivate Your Account, then you will no longer receive any communications from us, and users will not be able to interact with you; however Your Content will remain on the GoBlitz Platform. Once you deactivate your account, you can reactivate it any time by choosing to log in.<br>\n            You may require correction, deletion or blocking of your personal data (as appropriate) at any time by contacting us via the contact address as displayed below in the “Contact us” section. Even after request for deletion, User Contribution made by you on our website may remain viewable in cached and archived pages or might have been copied or stored by other users of our websites. User Contribution, Proper access and use of information provided on our website is governed by our Terms of Use.\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>We will use information only in accordance with the Privacy Policy under which the information was collected unless it has received explicit authorization.</strong>\n        </div>\n        <div class=\"mb-10\" style=\"font-size:14px; line-height: 24px;\">\n            <strong>Contact us</strong><br>\n            You can contact us at any time by email under <a href=\"mailto:support@goblitz.tv\" target=\"_blank\">support@GoBlitz.tv</a>\n        </div>\n    </div>\n</div>"

